analyses.value:
Linear Mixed Effects Model;
To more flexibly control for unbalanced number of trials between force conditions and the loss of data which occurs by averaging, absolute target error from all trials will entered into a linear mixed effects model. The model will include fixed effects of group (adults who stutter/adults who do not stutter), trial type (no force/up force/down force) and feedback type (no accuracy feedback/accuracy feedback). The model will also have random effects of trial and participant. 

Mixed Design ANOVAs;
Since the linear mixed effects model does not allow us to analyze performance variability across trials, variable target error (standard deviation of constant error) will be analyzed in a 2 (group: adults who stutter/adults who do not stutter) x 3 (trial type: no force/up force/down force) x 2 (feedback type: no accuracy feedback/accuracy feedback) mixed design ANOVA. To account for the fact there will be more no force than force trials, we will randomly select 10 no force trials for each participant to calculate standard deviation from and compare with the standard deviation of the 10 up and 10 down force trials. 
As additional analysis of absolute error, we will also take participants’ mean absolute error of these randomly selected trials and the corresponding up and down force trials and enter them into an ANOVA of the same design.

dependent.value:
This experiment will be performed immediately after a separate task which has also been preregistered under the title “Speech motor adaptation to mandibular force-field perturbations in adults who stutter”. Data for this experiment will therefore be from the same group of participants as detailed for that preregistration.
Participants will be seated with their lower jaw physically coupled to a 3D-position robotic device by a custom-made dental appliance. A head-worn visual display will show a position cursor which is moved by the participant opening and closing their jaw. On each trial, their task will be to move the cursor from a green start position down to a red target region and back again at a self-selected speed. The cursor will only remain visible in the upper portion of the display. On 1 in 3 trials, an upward or downward force will be applied to the jaw along the primary axis of jaw opening (extracted using PCA analysis of a speech sample in pretest; same position axis controlling the cursor movement). Force magnitude will be proportional to the extent of opening with a target peak of 1N (force-field gain necessary to achieve this also extracted during pre-test procedure). There will be 2 blocks of 60 trials (40 no-force, 10 up-force, 10 down-force), with the first block including no visual feedback about target accuracy and the second block including visual feedback of target accuracy after each trial. Each block will be preceded by practice trials with full cursor visual feedback, and after every epoch of 6 trials (4 no-force, 1 up-force, 1 down-force) in the main task a short target tracking task will be performed to maintain visual-somatosensory “alignment” (move and hold the visual cursor at various target locations distributed across the height of the screen with full cursor visual feedback). Trial-by-trial errors will be assessed by comparing the peak jaw displacement with the center of the target region.

DV1 – Absolute Target Error;
To measure movement accuracy, absolute target error will be used. Firstly, the absolute target error from all trials and conditions will be collectively entered into a linear mixed effects models as detailed in the analysis section below. Secondly, a mean absolute target error will be calculated from a random selection of 10 no force trials to compare with the mean of the 10 up and 10 down force trials in a separate mixed analysis of variance.

DV 2 – Variable Target Error;
To measure movement precision, variable target error will be used (i.e., standard deviation of the constant [signed as negative or positive with respect to the target] error). This will be calculated and compared for a random selection of 10 no force trials vs. the 10 up and 10 down force trials in a mixed analysis of variance only.

